import React from 'react'

const DisplayHemisphere = (props) => {
    const { latitude } = props;

    const hemisphere = latitude > 0 ? 'Bạn đang ở việt nam ' : 'Bạn đang ở nước khác'
    return (

        <div>
            {hemisphere}
        </div>
    )
}

export default DisplayHemisphere;
